import Page from "./menuAwal/Page";
import "../src/menuAwal/Page.css";

function App() {
  return (
    <div className="App">
      <Router>
        <Routes>
          <Route path="/" element={<Page />} />
          <Route path="/indo" element={<Indo />} />
        </Routes>
      </Router>
    </div>
  );
}

export default App;
